import Link from "next/link";
import styled from "styled-components";

const NavLink = styled.a`
  margin-left: 20px;
  :hover {
    cursor: pointer;
  }
`;

const Nav = () => (
  <div className="nav">
    <Link href="/">
      <NavLink>Home</NavLink>
    </Link>
    <Link href="/about">
      <NavLink>About</NavLink>
    </Link>
  </div>
);

export default Nav;
